// src/components/SignIn.tsx
import React from 'react';
import { useAppDispatch, useAppSelector } from '../redux/hooks.ts';
import { toggleLoginVisibility, setEmail, setPassword } from '../redux/slices/authSlice.ts';
import '../styles/sign-in.css';


const SignIn: React.FC = () => {
  const dispatch = useAppDispatch();
  const { email, password, isLoginVisible } = useAppSelector((state) => state.auth);

  const handleLogin = (e: React.FormEvent) => {
    e.preventDefault();
    console.log('Logging in with', email, password);
  };

  return (
    <div>
      {isLoginVisible ? (
        <form onSubmit={handleLogin}>
          <input
            type="email"
            value={email}
            onChange={(e) => dispatch(setEmail(e.target.value))}
          />
          <input
            type="password"
            value={password}
            onChange={(e) => dispatch(setPassword(e.target.value))}
          />
          <button type="submit">Login</button>
        </form>
      ) : (
        <button onClick={() => dispatch(toggleLoginVisibility())}>Go to Login</button>
      )}
    </div>
  );
};

export default SignIn;
